#endif
  
  SWIG_InstallConstants(d,swig_const_table);
  
  SWIG_Python_SetConstant(d, "char_bit",SWIG_From_int(static_cast< int >(CHAR_BIT)));
  SWIG_Python_SetConstant(d, "schar_min",SWIG_From_int(static_cast< int >(SCHAR_MIN)));
  SWIG_Python_SetConstant(d, "schar_max",SWIG_From_int(static_cast< int >(SCHAR_MAX)));
  SWIG_Python_SetConstant(d, "uchar_max",SWIG_From_int(static_cast< int >(UCHAR_MAX)));
  SWIG_Python_SetConstant(d, "char_min",SWIG_From_int(static_cast< int >(CHAR_MIN)));
  SWIG_Python_SetConstant(d, "char_max",SWIG_From_int(static_cast< int >(CHAR_MAX)));
  SWIG_Python_SetConstant(d, "mb_len_max",SWIG_From_int(static_cast< int >(MB_LEN_MAX)));
