  SWIG_Python_SetConstant(d, "shrt_max",SWIG_From_int(static_cast< int >(SHRT_MAX)));
  SWIG_Python_SetConstant(d, "ushrt_max",SWIG_From_int(static_cast< int >(USHRT_MAX)));
