  SWIG_Python_SetConstant(d, "ulong_max",SWIG_From_int(static_cast< int >(ULONG_MAX)));
  SWIG_Python_SetConstant(d, "llong_min",SWIG_From_int(static_cast< int >(LLONG_MIN)));
  SWIG_Python_SetConstant(d, "llong_max",SWIG_From_int(static_cast< int >(LLONG_MAX)));
